#include<iostream>
using namespace std;
void swap(int *x, int *y)
{
	int tmp;
	tmp = *x;
	*x = *y;
	*y = tmp;
}
int Bubble(int A[], int n)
{
	int i, j,swaps ,comparisons = 1;
	//loop for No of Passes
	for(i = 0; i<n-1; i++)
	{	
		swaps = 0;
		//loop for Swaps
		for(j = 0; j<n-1-i; j++)
		{
			comparisons++;
			if(A[j] > A[j+1])
			{
				swap(&A[j], &A[j+1]);
				swaps = 1;
			}
		}
			//if no swaps are done during entire list then return function (Adaptive).
			if(swaps == 0)
				return comparisons;
		}
	}
void Insertion(int A[], int n)
{
	int i, j,x ;
	//for Passes
	for(i = 1; i<n ;i++)
	{
		
		x = A[i];
		//if "element > x" shift it right.
		for(j =i-1; j>=0; j--)
		{
			//shifting 
			if(A[j] > x)
				A[j+1] = A[j];
			else break;
		}
		A[j+1] = x;
	}
}
void Selection(int A[], int n)
{
	int i, j ,k;
	//for passes
	for(i = 0; i<n-1; i++)
	{
		for(j=k=i; j<n; j++)
		{
			if(A[j] < A[k]) //if smallest elemnent found, set k to that element.
			k = j;
		}
		swap(&A[i], &A[k]);
	}
}
void Merge(int A[], int l, int mid, int h)
{
	int i = l, j = mid+1 , k = l;
	//create auxiliary Array
	int B[h+1];
	//copy elements in B as sorted order i.e. merging
	while(i <= mid && j <= h)
	{
		if(A[i] < A[j])
			B[k++] = A[i++];
		else
			B[k++] = A[j++];
	}
	//copy remaining elements
	for(; i <= mid; i++)
		B[k++] = A[i];
	for(; j <= h; j++)
		B[k++] = A[j];
	//Now copy sorted list from B[] to A[]
	for(i = l; i<=h ;i++)
		A[i] = B[i];

}
 void mergeSort(int A[], int l, int h)
 {
 	int mid;
	
 	if(l < h)
 	{
	 mid = (l+h)/2;
 	//Merge Sort left subArray
 	mergeSort(A, l,mid);
 	//Merge Sort right subArray
 	mergeSort(A,mid+1,h);
 	//Now merge elemnents at returning time
 	Merge(A, l,mid,h);
 	}	
}
	
